Paquito D'Rivera - The Lost Sessions

Original release 1976, 1978
Remastered 2002

Brought to you by TQMP
The Quality Music Project

Featuring Irakere.

A rare discovery of virtually unknown recordings. These are the unreleased sessions long awaited by every Latin jazz fan. These sessions were recorded in La Habana between 1976 and 1978, but between his excellent sound quality and the innovative music that Paquito created, we were amazed to discover that they sound like they were recorded yesterday! A great mix of Jazz and Latin groove. With Arturo Sandoval, Chucho Valdes, Carlos Emilio Morales and Oscar Valdes.
-- amazon.com

